import React from 'react';
import PropTypes from 'prop-types';
import './AssetTypesInfo.scss';

const AssetTypeInfo = props => {
  const { Data } = props;
  const DaysToProcess =
    Data && Data.days_to_process ? Data.days_to_process : '';
  const Attributes =
    Data && Data.attribute
      ? Data.attribute.map(attribute => {
          return <div key={attribute.id}>{attribute.name}</div>;
        })
      : [];
  return (
    <div>
      <p>
        {' '}
        <span className="header">Days to Process: </span> {DaysToProcess}{' '}
      </p>
      <p className="header">Attributes:</p>
      {Attributes}
    </div>
  );
};

AssetTypeInfo.propTypes = {
  Data: PropTypes.object.isRequired
};

export default AssetTypeInfo;
